import fetch from 'node-fetch';
import { createConnection } from 'mysql';


const dbConfig = {
    host: '127.0.0.1',
    user: 'ananthuer',
    password: 123456,
    database: 'mysql'
  };
  

  const connection = createConnection(dbConfig);

connection.connect((err) => {
  if (err) {
    console.error('Error connecting to database:', err);
    return;
  }
  console.log('Connected to the database!');
});


fetch('https://api.publicapis.org/entries')
  .then(response => response.json())
  .then(data => {
    // Process the fetched data
    // ...
  })
  .catch(error => console.error('Error fetching data:', error));


  // Assuming the fetched data is an array of objects
data.forEach(entry => {
    const { API, Description, Category } = entry;
  
    // Define the SQL query
    const query = `INSERT INTO your_table_name (api, description, category) VALUES (?, ?, ?)`;
  
    // Execute the query with data values
    connection.query(query, [API, Description, Category], (err, result) => {
      if (err) {
        console.error('Error inserting data:', err);
        return;
      }
      console.log('Data inserted successfully:', result);
    });
  });
  

  connection.end((err) => {
    if (err) {
      console.error('Error closing database connection:', err);
      return;
    }
    console.log('Database connection closed!');
  });
